    <style type="text/css">
        @keyframes fadein {
            from {
                opacity: 0
            }

            to {
                opacity: 1
            }
        }

        @-webkit-keyframes fadein {
            from {
                opacity: 0
            }

            to {
                opacity: 1
            }
        }

        @keyframes swing {
            0% {
                transform: rotate(0);
            }

            10% {
                transform: rotate(0);
            }

            90% {
                transform: rotate(720deg);
            }

            100% {
                transform: rotate(720deg);
            }
        }


        @-webkit-keyframes swing {
            0% {
                -webkit-transform: rotate(0)
            }

            10% {
                -webkit-transform: rotate(0)
            }

            90% {
                -webkit-transform: rotate(720deg)
            }

            100% {
                -webkit-transform: rotate(720deg)
            }

        }

